package com.citi.euces.sitiouec.dto;

public class ReporteWeekDTO {

	public String fecha;
	public String concepto;
	public double sab;
	public double lun;
	public double mar;
	public double mie;
	public double jue;
	public double vie;
	public double sem;

	public ReporteWeekDTO() {
		// TODO Auto-generated constructor stub
	}

	public String getFecha() {
		return fecha;
	}

	public void setFecha(String fecha) {
		this.fecha = fecha;
	}

	public String getConcepto() {
		return concepto;
	}

	public void setConcepto(String concepto) {
		this.concepto = concepto;
	}

	public double getSab() {
		return sab;
	}

	public void setSab(double sab) {
		this.sab = sab;
	}

	public double getLun() {
		return lun;
	}

	public void setLun(double lun) {
		this.lun = lun;
	}

	public double getMar() {
		return mar;
	}

	public void setMar(double mar) {
		this.mar = mar;
	}

	public double getMie() {
		return mie;
	}

	public void setMie(double mie) {
		this.mie = mie;
	}

	public double getJue() {
		return jue;
	}

	public void setJue(double jue) {
		this.jue = jue;
	}

	public double getVie() {
		return vie;
	}

	public void setVie(double vie) {
		this.vie = vie;
	}

	public double getSem() {
		return sem;
	}

	public void setSem(double sem) {
		this.sem = sem;
	}

}
